export default function ResultInfo() {
  return (
    <div className="info-cont">
      <div className="title-cont">
        <div>
          <p>title</p>
          <p>description</p>
        </div>
        <div>
          <img
            src={require("../Logo_della_Maserati.svg.png")}
            width="50px"
            height="50px"
            alt="img"
          ></img>
        </div>
      </div>
    </div>
  );
}
